import React from 'react';
import {data} from "./store/store.jsx"
import Product from "./components/productcart/Product"
import logo from './logo.svg';
import './App.css';





class App extends React.Component {
    constructor() {
        super();

        this.state = {
            qty: data
        };
    };

    removeElement (el){
        const newList = this.state.qty.filter(function (item){
            return item.id !== el.id;
            console.log(item.id );
        });
        this.setState({
            qty: newList
        });
    };
    render() {
        return (
            <div>
                {this.state.qty.map(el => {
                    return (
                        <div>
                            <Product key={el.id} el={el} removeElement={this.removeElement} />
                        </div>
                    )
                })}
            </div>
        )
    }


}


export default App;
